/* jshint strict:false, camelcase:false */
/* global test, module, equal, CryptoJS, keypunk */

/**
 * Test vectors for cryptographic hashes.
 *
 * This may seem like "testing your dependencies", and, well, it is. Javascript cryptographic libraries don't exactly have a
 * great track record in terms of reliability (which isn't a complaint - they're open source and mostly spare time projects,
 * after all). In fact, this very project includes a patch of a bug in the implementation of SHA-224 and SHA-384.
 * 
 * Disregarding the fact that a wrongly implemented cryptographic hash will undermine its security completely, KeyPunk is
 * VERY dependent on the reliability of the hashes, since it will hopefully, eventually, spread to a few other platforms, 
 * meaning different implementations which MUST arrive at the same value in order to generate the same passwords.
 */

module("standard");

