/**
 * Utility functions
 */

function descr(input)
{
	if (!input)
	{
		return "[empty string]";
	}

	if (typeof(input) !== "string")
	{
		input = input.toString();
	}

	if (input.length > 120)
	{
		return input.substr(0, 120) + " ... (" + input.length + " characters)";
	}
	return input;
}

function strrep(str, count)
{
	return new Array(count + 1).join(str);
}

function wa(input)
{
	return CryptoJS.enc.Hex.parse(input);
}

/**
 * Plain hash testing utility functions
 */
function ripemd160(expected, input)
{
	var hash = keypunk.core.getHash("ripemd-160", input, "");
	equal(hash.toString(), expected, descr(input));
}

